import React, { useState } from 'react';
import { /*TextField,*/ Paper, Button } from '@mui/material';
import { DataGrid } from '@mui/x-data-grid';

const MHPPage = () => {
  let bgcolor = '#' + '80A1D4'
  let background = {backgroundColor: bgcolor}
  // let underline = {textDecoration: 'underline'}
  let [isEditing, setIsEditing] = useState(false);

  const submit = () => {
    console.log('submit')
    setIsEditing(!isEditing)
  }

  const dropdown = () => {
    return(
    <div className="mui-dropdown">
    <button className="mui-btn mui-btn--primary" data-mui-toggle="dropdown">
      Dropdown
      <span className="mui-caret"></span>
    </button>
    <ul className="mui-dropdown__menu">
      <li><a href="#">Option 1</a></li>
      <li><a href="#">Option 2</a></li>
      <li><a href="#">Option 3</a></li>
      <li><a href="#">Option 4</a></li>
    </ul>
  </div>
  )
  }
  let drop = dropdown()

  const columns = [
    { field: 'id', headerName: 'ID', width: 70 },
    { field: 'firstName', headerName: 'First name', width: 130 },
    { field: 'lastName', headerName: 'Last name', width: 130 },
    { field: 'status', headerName: 'Status', width: 130}
  ]

  const rows = [
    { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35, status: drop },
    { id: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
    { id: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
    { id: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
  ]

  return (
    <>
      <Paper elevation={3} sx={{height: 200, width: '50%', marginLeft: '25%', marginRight: '25%', paddingBottom: '2vw', marginBottom: '5vw', borderRadius: '6px'}}>
        <h1 style={{textAlign: 'center', ...background, borderRadius: '6px'}}>Mental Health Provider</h1>
        {isEditing ? 
        <>
          <DataGrid rows={rows} columns={columns} pageSize={2} rowsPerPageOptions={[2]} checkboxSelection/>
          <Button onClick={() => submit()}>Submit</Button><Button onClick={() => setIsEditing(!isEditing)}>Cancel</Button>
        </>
        :
        <>
          <Button onClick={() => setIsEditing(!isEditing)}>Edit</Button>
        </>
        }

      </Paper>
    </>
  )
}

export default MHPPage;
